import React, { Component } from 'react'
import { Tabs, Icon } from 'antd'
import { withTranslation } from 'react-i18next'

import PollsStatistic from './StatisticComponents/PollsStatistic'
import AttendancesStatistic from './StatisticComponents/AttendancesStatistic'
// import pollIcon from '@misc/images/toolbar/poll.svg'
const { TabPane } = Tabs

class ConferenceStatistic extends Component {
  render() {
    const {
      props: { i18n, conferenceId, conferenceUsers }
    } = this

    return (
      <Tabs>
        <TabPane
          tab={
            <span>
              <Icon type='bar-chart' />
              {i18n.t('statistic.polls')}
            </span>
          }
          key='1'
        >
          <PollsStatistic conferenceId={conferenceId} conferenceUsers={conferenceUsers} />
        </TabPane>

        <TabPane
          tab={
            <span>
              <Icon type='carry-out' />
              {i18n.t('statistic.attendances')}
            </span>
          }
          key='2'
        >
          <AttendancesStatistic conferenceId={conferenceId} conferenceUsers={conferenceUsers} />
        </TabPane>
      </Tabs>
    )
  }
}
export default withTranslation()(ConferenceStatistic)
